import React, {Component} from 'react'
import './style/dashboard.css'
export default class Dashboard extends Component{

    constructor(props){
        super(props)
        this.state = {
            username: ''
        }
    }
    
    render(){
        return(
            <div>
            <h1>
                <span></span>
                <span></span>
                <span></span>
                <span></span>
                Hello form dashboard
            </h1>
            </div>
            
        )
    }
}
